class StateManager(Object):    def __init__(self):        self.states = {}        self.currentState = False            def addState(self, state):        if state.id in self.states.keys():            print("[StateManager] State '%s' is already registered! Please clean it up first!" %state.id)            return                else:            self.states[state.id] = state                        #If this is the first state to be added, set it to the current state            if not self.currentState:                self.currentState = state                    def removeState(self, stateID):        del self.sates[stateID]            def setState(self, stateID):        if stateID in self.states.keys():            self.currentState = self.states[stateID]                    else:            print("[StateManager] State '%s' is not a valid state! Please register it first!" %stateID)            